import Card from "../card/card.js"
import "./trending.css"


const Trending = ({trendingNfts}) => {

    const displayArray = Promise.all(trendingNfts).map((obj,i) => {
        // const data = obj.then(response => response.data)
        return <Card
                key={obj.id}
                title={obj.name}
            />        
    })

    return(
        <div className="trending">
                {displayArray}
        </div>
    )
}

export default Trending;
